INSERT INTO `introduccions` (`id`, `seccion`, `contenido`, `created_at`, `updated_at`) VALUES
(1, 'Vectores', '<h2 style=\"margin-bottom: 10px; font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; line-height: 24px; color: rgb(0, 0, 0); text-align: center; padding: 0px;\"></h2><h6 style=\"text-align: left; line-height: 150%;\"><div style=\"text-align: center;\"><b style=\"color: inherit; font-family: inherit; font-size: 1rem;\"><span lang=\"ES\" style=\"font-size:20.0pt;line-height:150%;mso-bidi-font-family:Calibri;\r\nmso-bidi-theme-font:minor-latin;mso-ansi-language:ES\"><span style=\"font-family: Arial;\">VECTORES</span></span></b></div><b>Introducción<br></b><span lang=\"ES\">Un vector es un ente matemático caracterizado por tres elementos: modulo\r\ndirección y sentido, las magnitudes vectoriales que son aquellas que quedan\r\ndescritas mediante:<br></span><b>Módulo de un vector<br></b><span lang=\"ES\">la magnitud de una cantidad vectorial recibe el nombre de módulo del vector,\r\nel módulo de un vector es la longitud entre el inicio y el final del vector, es\r\ndecir dónde empieza y termina la flecha.<br></span><b>Dirección<br></b><span lang=\"ES\">es la acción o efecto de dirigir o dirigirse, es el ángulo del vector con\r\nrespecto al eje x<br></span><b>Sentido<br></b><span lang=\"ES\">es la orientación del segmento del origen al extremo del vector y está indicado\r\npor la punta de la flecha<br></span><b>Tipos de vector<br></b><b>Vectores Paralelos<br> </b><span lang=\"ES\">Se dice que dos o más vectores son paralelos, cuando poseen la misma\r\ndirección, sin importar el sentido, módulo o localización en el espacio.<br><div style=\"text-align: center;\"><span lang=\"ES\" style=\"color: inherit; font-family: inherit; font-size: 1rem;\">&nbsp;</span><img src=\"data:image/png;base64,\" data-filename=\"1.png\" style=\"color: inherit; font-family: inherit; font-size: 1rem; width: 310px;\"></div></span></h6><h6 style=\"text-align: left; line-height: 150%;\"><span lang=\"ES\"><br></span><b>Vectores perpendiculares<br></b><span lang=\"ES\">son vectores perpendiculares u ortogonales, aquellos que se cortan en 90º, o\r\nque sus líneas de acción se cortan en un ángulo recto de 90º.</span></h6><h6 style=\"text-align: left; line-height: 150%;\"><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" data-filename=\"2.png\" style=\"color: inherit; font-family: inherit; font-size: 1rem; width: 259px;\"></div><b>vectores coplanares y colineales<br> </b><span lang=\"ES\">son vectores coplanares aquellos que se hallan en el mismo plano o con\r\nlineales aquellos que se encuentran sobre la misma línea de acción.<br></span><b>Vectores concurrentes<br></b><span lang=\"ES\">se denominan vectores concurrentes a aquellos cuyas líneas de acción se\r\ninterceptan en un punto.<br><div style=\"text-align: center;\"><span lang=\"ES\" style=\"color: inherit; font-family: inherit; font-size: 1rem;\">&nbsp;</span><img src=\"data:image/png;base64,\" data-filename=\"3.png\" style=\"color: inherit; font-family: inherit; font-size: 1rem; width: 161px;\"></div></span><b>Vector cero<br></b><span lang=\"ES\">un vector a es igual a cero si su módulo a es cero.<br></span><b>Adición de vectores<br> </b><span lang=\"ES\">La adición de vectores solamente está definida para vectores de la misma\r\nnaturaleza.<br></span><span lang=\"ES\">La suma de vectores es formar una cadena de vectores donde el vector que\r\nengloba a todos los vectores es el vector de la suma. En otras palabras, la\r\nsuma de vectores es la unión de vectores a través de juntar la parte delantera\r\nde un vector con la parte trasera del otro y cumple con la propiedad\r\nconmutativa.<br><div style=\"text-align: center;\"><span lang=\"ES\" style=\"color: inherit; font-family: inherit; font-size: 1rem;\">&nbsp;</span><img src=\"data:image/png;base64,\" data-filename=\"4.png\" style=\"color: inherit; font-family: inherit; font-size: 1rem; width: 253px;\"></div></span><span lang=\"ES\">&nbsp;<br></span><b>MULTIPLICACIÓN DE UN VECTOR POR ESCALARES<br></b><span lang=\"ES\">Sea m un escalar positivo y a un vector, la expresión ma es un vector de\r\nmagnitud ma con la misma dirección y sentido ue a; y si na es negativo, ma es\r\nun vector de magnitud lm I a, de la misma dirección que a pero de sentido\r\nopuesto.</span></h6><h6 style=\"text-align: left; line-height: 150%;\"><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" data-filename=\"5.png\" style=\"color: inherit; font-family: inherit; font-size: 1rem; width: 211px;\"></div><b>PROPIEDADES DEL PRODUCTO POR ESCALARES<br><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 1rem; font-weight: 500;\">Distributivita</span></div></b><span lang=\"ES\" style=\"font-size:10.0pt;mso-bidi-font-size:11.0pt;line-height:150%;\r\nmso-ansi-language:ES\"><div style=\"text-align: center;\"><span style=\"font-size: 10pt; color: inherit; font-family: inherit;\">(m + n)a = ma + na</span></div></span><span lang=\"ES\" style=\"font-size:10.0pt;mso-bidi-font-size:11.0pt;line-height:150%;\r\nmso-ansi-language:ES\"><div style=\"text-align: center;\"><span style=\"font-size: 10pt; color: inherit; font-family: inherit;\">m(a + b) — ma + mb</span></div></span><span lang=\"ES\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 1rem;\">Asociatividad &nbsp;&nbsp;m(na) = (mn)a escrito mna</span></div></span><span lang=\"ES\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 1rem;\">Multiplicación de m I por a</span></div></span><span lang=\"ES\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 1rem;\">1a = a</span></div></span><span lang=\"ES\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 1rem;\">Producto de m ——1 por a</span></div></span><span lang=\"ES\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 1rem;\">—1a — a</span></div></span><span lang=\"ES\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 1rem;\">Multiplicación de un escalar m = 0 , por\r\nel vector a</span></div></span><span lang=\"ES\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 1rem;\">0a = 0&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; donde: 0 es el vector cero</span></div></span><b>VECTORES UNITARIOS<br></b><span lang=\"ES\">Son vectores que tienen de módulo la unidad. Para un sistema de\r\ncoordenadas, ya sea en el plano o en el espacio, definimos un vector unitario\r\nen cada eje, cuyas direcciones y sentidos coinciden con las direcciones y sentidos\r\ndel lado positivo de cada eje. Estos vectores unitarios que los denotamos por\r\ni, j, k, se muestran en las figuras&nbsp;</span></h6><h6 style=\"text-align: center; line-height: 150%;\"><img src=\"data:image/png;base64,\" style=\"width: 238px;\" data-filename=\"6.png\"><span lang=\"ES\"><br></span></h6>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"line-height: 150%;\"><v:shapetype id=\"_x0000_t75\" coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\" path=\"m@4@5l@4@11@9@11@9@5xe\" filled=\"f\" stroked=\"f\">\r\n <v:stroke joinstyle=\"miter\">\r\n <v:formulas>\r\n  <v:f eqn=\"if lineDrawn pixelLineWidth 0\">\r\n  <v:f eqn=\"sum @0 1 0\">\r\n  <v:f eqn=\"sum 0 0 @1\">\r\n  <v:f eqn=\"prod @2 1 2\">\r\n  <v:f eqn=\"prod @3 21600 pixelWidth\">\r\n  <v:f eqn=\"prod @3 21600 pixelHeight\">\r\n  <v:f eqn=\"sum @0 0 1\">\r\n  <v:f eqn=\"prod @6 1 2\">\r\n  <v:f eqn=\"prod @7 21600 pixelWidth\">\r\n  <v:f eqn=\"sum @8 21600 0\">\r\n  <v:f eqn=\"prod @7 21600 pixelHeight\">\r\n  <v:f eqn=\"sum @10 21600 0\">\r\n </v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:formulas>\r\n <v:path o:extrusionok=\"f\" gradientshapeok=\"t\" o:connecttype=\"rect\">\r\n <o:lock v:ext=\"edit\" aspectratio=\"t\">\r\n</o:lock></v:path></v:stroke></v:shapetype><v:shape id=\"Imagen_x0020_1\" o:spid=\"_x0000_i1030\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:233.25pt;\r\n height:70.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image001.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"41525f\" cropbottom=\"10717f\" cropleft=\"20249f\" cropright=\"20501f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"line-height: 150%;\"><v:shape id=\"Imagen_x0020_2\" o:spid=\"_x0000_i1029\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:194.25pt;height:71.25pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image002.png\" o:title=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"18821f\" cropbottom=\"34766f\" cropleft=\"30164f\" cropright=\"17140f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"line-height: 150%;\"><v:shape id=\"Imagen_x0020_3\" o:spid=\"_x0000_i1028\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:120.75pt;height:102.75pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image002.png\" o:title=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"47649f\" cropbottom=\"3249f\" cropleft=\"37305f\" cropright=\"18568f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"line-height: 150%;\"><v:shape id=\"Imagen_x0020_4\" o:spid=\"_x0000_i1027\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:189.75pt;height:94.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image003.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"23301f\" cropbottom=\"28492f\" cropleft=\"31172f\" cropright=\"18905f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"line-height: 150%;\"><v:shape id=\"Imagen_x0020_5\" o:spid=\"_x0000_i1026\" type=\"#_x0000_t75\" alt=\"Diagrama, Texto, Carta\r\n\r\nDescripción generada automáticamente\" style=\"width:158.25pt;height:103.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image004.jpg\" o:title=\"Diagrama, Texto, Carta\r\n\r\nDescripción generada automáticamente\" croptop=\"34465f\" cropbottom=\"19287f\" cropleft=\"37809f\" cropright=\"5546f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"line-height: 150%;\"><v:shape id=\"Imagen_x0020_6\" o:spid=\"_x0000_i1025\" type=\"#_x0000_t75\" alt=\"Imagen que contiene Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:178.5pt;height:93pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image005.png\" o:title=\"Imagen que contiene Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"42720f\" cropbottom=\"9971f\" cropleft=\"31255f\" cropright=\"20417f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>', '2021-10-22 13:18:56', '2021-11-12 18:47:37');
INSERT INTO `introduccions` (`id`, `seccion`, `contenido`, `created_at`, `updated_at`) VALUES
(2, 'Movimiento rectilíneo', '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:150%\"><b><i><span lang=\"ES\" style=\"font-size:26.0pt;line-height:150%;mso-ansi-language:ES\">CINEMATICA<o:p></o:p></span></i></b></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:150%\"><b><i><span lang=\"ES\" style=\"font-size:18.0pt;line-height:150%;mso-ansi-language:ES\">MOVIMIENTO\r\nRECTILINEO Y PARABOLICO<o:p></o:p></span></i></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:150%\"><b>Introducción <o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:150%\"><span lang=\"ES\">La cinemática, que es una parte de la mecánica, estudia el movimiento de\r\nlos objetos sin tomar en cuenta las causas que lo originan. Para describir. Tal\r\nmovimiento, la cinemática hace uso de ecuaciones que relacionen las variables\r\nde movimiento, éstas son: desplazamiento (x), velocidad (v), aceleración (a) y\r\ntiempo (t).<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:150%\"><span lang=\"ES\">Albert Einstein, alrededor de 1905, modifica sustancialmente los conceptos\r\nde la mecánica a través de su \"teoría de la relatividad\", de manera\r\nque en la actualidad se habla de una mecánica relativista, donde la mecánica\r\nclásica sólo es un caso particular. Es así que la mecánica relativista se ocupa\r\nen forma general de objetos moviéndose a velocidades cercanas a la de la luz,\r\nen tanto que la mecánica clásica estudia el movimiento de objetos a velocidades\r\nmucho menores.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:150%\"><b>EL MOVIMIENTO UN CONCEPTO RELATIVO<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:150%\"><span lang=\"ES\">El primer paso para el estudio del movimiento es elegir un sistema de\r\nreferencia respecto al cual el observador describe la posición y movimiento de\r\nun objeto. <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:150%\"><span lang=\"ES\">Por ejemplo, si una soleada mañana de septiembre Ud. sale a dar un paseo en\r\nsu \'t convertible guindo metálico\"; entonces, para estudiar su movimiento,\r\nalgunos de los posibles sistemas de referencia son: <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">a)&nbsp;&nbsp; Una\r\ncasa a la orilla de la carretera<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">b)&nbsp;&nbsp; Un\r\navión en movimiento<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">d)&nbsp; &nbsp;El centro del sol<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal\"><v:shapetype id=\"_x0000_t75\" coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\" path=\"m@4@5l@4@11@9@11@9@5xe\" filled=\"f\" stroked=\"f\">\r\n <v:stroke joinstyle=\"miter\">\r\n <v:formulas>\r\n  <v:f eqn=\"if lineDrawn pixelLineWidth 0\">\r\n  <v:f eqn=\"sum @0 1 0\">\r\n  <v:f eqn=\"sum 0 0 @1\">\r\n  <v:f eqn=\"prod @2 1 2\">\r\n  <v:f eqn=\"prod @3 21600 pixelWidth\">\r\n  <v:f eqn=\"prod @3 21600 pixelHeight\">\r\n  <v:f eqn=\"sum @0 0 1\">\r\n  <v:f eqn=\"prod @6 1 2\">\r\n  <v:f eqn=\"prod @7 21600 pixelWidth\">\r\n  <v:f eqn=\"sum @8 21600 0\">\r\n  <v:f eqn=\"prod @7 21600 pixelHeight\">\r\n  <v:f eqn=\"sum @10 21600 0\">\r\n </v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:formulas>\r\n <v:path o:extrusionok=\"f\" gradientshapeok=\"t\" o:connecttype=\"rect\">\r\n <o:lock v:ext=\"edit\" aspectratio=\"t\">\r\n</o:lock></v:path></v:stroke></v:shapetype><v:shape id=\"Imagen_x0020_10\" o:spid=\"_x0000_i1047\" type=\"#_x0000_t75\" alt=\"Diagrama\r\n\r\nDescripción generada automáticamente\" style=\"width:234.75pt;\r\n height:153.75pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image001.png\" o:title=\"Diagrama\r\n\r\nDescripción generada automáticamente\" croptop=\"13386f\" cropbottom=\"20726f\" cropleft=\"18891f\" cropright=\"19745f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal\"><img src=\"data:image/png;base64,\" style=\"width: 313px;\" data-filename=\"1.png\"><span lang=\"ES\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:normal\"><span lang=\"ES\">Ahora bien, un sistema de referencia puede estar en reposo, en movimiento\r\ncon velocidad constante, o en movimiento acelerado, en cualquiera de los dos\r\nprimeros casos se dice que el sistema de referencia es inercial; en el último\r\ncaso, el sistema de referencia es no inercial, por ejemplo, un cuerpo en caída\r\nlibre es un sistema de referencia no inercial.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:normal\"><span lang=\"ES\">Para la mayoría de los casos, la Tierra es un adecuado sistema de\r\nreferencia inercial; sin embargo, sabemos todos que la tierra tiene un\r\nmovimiento combinado de rotación y traslación con respecto al Sol. Este nuestro\r\nsol, juntamente con sus nueve planetas, tiene también un movimiento de\r\nrevolución respecto del centro de la Galaxia.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:normal\"><b>POSICIÓN, DESPLAZAMIENTO Y TRAYECTORIA<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:normal\"><span lang=\"ES\">Una vez elegido el sistema de referencia y establecido el origen en ese\r\nsistema, puede identificarse claramente el lugar donde se encuentra el objeto\r\nen estudio, esto se efectúa mediante un vector r llamado vector de posición,\r\nque nos indica la distancia y la dirección a la que se encuentra el objeto con\r\nrespecto al origen del sistema de referencia elegido, como muestra la figura<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal\"><v:rect id=\"_x0000_s1027\" style=\"position:absolute;left:0;text-align:left;\r\n margin-left:291.6pt;margin-top:121.05pt;width:71.4pt;height:18.6pt;z-index:251659264\" fillcolor=\"white [3212]\" stroked=\"f\"><v:rect id=\"_x0000_s1026\" style=\"position: absolute; left: 0px; margin-left: 100.8pt; margin-top: 119.25pt; width: 71.4pt; height: 18.6pt; z-index: 251658240;\" fillcolor=\"white [3212]\" stroked=\"f\"><v:shape id=\"Imagen_x0020_11\" o:spid=\"_x0000_i1046\" type=\"#_x0000_t75\" alt=\"Diagrama\r\n\r\nDescripción generada automáticamente\" style=\"width:357pt;height:146.25pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image002.png\" o:title=\"Diagrama\r\n\r\nDescripción generada automáticamente\" croptop=\"30023f\" cropbottom=\"14153f\" cropleft=\"17980f\" cropright=\"18317f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></v:rect></v:rect></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: center; line-height: normal;\"><span lang=\"ES\">&nbsp;</span><img src=\"data:image/png;base64,\" style=\"width: 477px;\" data-filename=\"2.png\"></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:normal\"><span lang=\"ES\">La diferencia vectorial A r = fr- ro , que es el cambio neto de posición\r\ndel objeto al trasladarse del punto (1) al (2) se conoce como el vector\r\ndesplazamiento d.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:normal\"><span lang=\"ES\">La forma característica en que un móvil se traslada de un punto a otro,\r\nsegmento curvilíneo en la figura 3.3, se conoce como la trayectoria, y la\r\nlongitud de ésta, es el espacio recorrido por el móvil. Nótese que el\r\ndesplazamiento no necesariamente coincide con la trayectoria, ya que esta última\r\nrealmente puede ser de una forma caprichosa.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal\"><v:shape id=\"Imagen_x0020_12\" o:spid=\"_x0000_i1045\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica\r\n\r\nDescripción generada automáticamente con confianza media\" style=\"width:243pt;height:141.75pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image003.png\" o:title=\"Interfaz de usuario gráfica\r\n\r\nDescripción generada automáticamente con confianza media\" croptop=\"16966f\" cropbottom=\"27551f\" cropleft=\"20354f\" cropright=\"24829f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal\"><img src=\"data:image/png;base64,\" style=\"width: 325px;\" data-filename=\"3.png\"><span lang=\"ES\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:normal;tab-stops:79.2pt\"><b><span lang=\"ES\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;mso-ansi-language:\r\nES\">VELOCIDAD&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:normal;tab-stops:79.2pt\"><span lang=\"ES\">Es la rapidez con que un objeto cambia su posición\r\nal transcurrir el tiempo. Ahora bien, al ir cambiando de posición, el objeto\r\npuede tener una combinación de movimientos de traslación, vibración, y rotación.</span></p><p class=\"MsoNormal\" style=\"text-align: center; line-height: normal;\"><img src=\"data:image/png;base64,\" style=\"width: 382px;\" data-filename=\"4.png\"><br></p><p class=\"MsoNormal\" style=\"line-height:normal;tab-stops:79.2pt\"><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal;\r\ntab-stops:79.2pt\"><v:shape id=\"Imagen_x0020_13\" o:spid=\"_x0000_i1044\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:286.5pt;height:96.75pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image004.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"27185f\" cropbottom=\"23713f\" cropleft=\"18653f\" cropright=\"22434f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:normal;tab-stops:79.2pt\"><b>VELOCIDAD MEDIA <o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:normal;tab-stops:79.2pt\"><span lang=\"ES\">La velocidad media de una partícula es el cociente\r\ndel cambio neto de posición entre el tiempo total transcurrido durante ese\r\ncambio. Para encontrar una ecuación de la velocidad media consideremos el\r\nmovimiento de una partícula a lo largo de una trayectoria cualquiera como el de\r\nla figura<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal;\r\ntab-stops:79.2pt\"><v:shape id=\"Imagen_x0020_15\" o:spid=\"_x0000_i1043\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:181.5pt;height:135pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image005.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"37492f\" cropbottom=\"8028f\" cropleft=\"32264f\" cropright=\"18148f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:normal;tab-stops:79.2pt\"><span lang=\"ES\">En el instante t1 la posición de la partícula\r\nqueda determinado por el vector de posición r1, y momentos más tarde, r2 es el\r\nque fija su posición para el instante t2. El cambio neto de posición es Ar = h\r\n— y el tiempo total transcurrido durante este cambio de posición es<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:normal;tab-stops:79.2pt\"><span lang=\"ES\">At = t2 — t1. Entonces la velocidad media se\r\nescribe:</span></p><p class=\"MsoNormal\" style=\"text-align: center; line-height: normal;\"><img src=\"data:image/png;base64,\" style=\"width: 159px;\" data-filename=\"6.png\"><br></p><p class=\"MsoNormal\" style=\"line-height:normal;tab-stops:79.2pt\"><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal;\r\ntab-stops:79.2pt\"><v:shape id=\"Imagen_x0020_14\" o:spid=\"_x0000_i1042\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:119.25pt;height:45pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image005.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"37342f\" cropbottom=\"22667f\" cropleft=\"18905f\" cropright=\"38481f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:9.7pt;line-height:109%;tab-stops:center 128.2pt 363.35pt\"><span lang=\"ES\" style=\"font-size:10.0pt;mso-bidi-font-size:11.0pt;line-height:109%;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-ansi-language:ES\">Unidades de V&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:normal;tab-stops:79.2pt\"><span lang=\"ES\" style=\"font-size:9.0pt;mso-bidi-font-size:11.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:ES\">En el S.l.\r\ntenemos: </span><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal;\r\ntab-stops:79.2pt\"><v:shape id=\"Imagen_x0020_16\" o:spid=\"_x0000_i1041\" type=\"#_x0000_t75\" alt=\"Diagrama\r\n\r\nDescripción generada automáticamente\" style=\"width:90.75pt;height:36pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image006.png\" o:title=\"Diagrama\r\n\r\nDescripción generada automáticamente\" croptop=\"26140f\" cropbottom=\"32526f\" cropleft=\"24450f\" cropright=\"31339f\">\r\n</v:imagedata></v:shape><img src=\"data:image/png;base64,\" style=\"width: 127px;\" data-filename=\"7.png\">&nbsp;<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal;\r\ntab-stops:79.2pt\"><v:shape id=\"Imagen_x0020_17\" o:spid=\"_x0000_i1040\" type=\"#_x0000_t75\" alt=\"Diagrama\r\n\r\nDescripción generada automáticamente\" style=\"width:295.5pt;height:37.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image006.png\" o:title=\"Diagrama\r\n\r\nDescripción generada automáticamente\" croptop=\"37194f\" cropbottom=\"22816f\" cropleft=\"22350f\" cropright=\"21425f\">\r\n</v:imagedata></v:shape><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal\"><img src=\"data:image/png;base64,\" style=\"width: 394px;\" data-filename=\"8.png\"><br></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:normal\"><b>VELOCIDAD INSTANTÁNEA <o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:normal\"><span lang=\"ES\">La velocidad instantánea es la velocidad que posee una partícula en cada\r\npunto y en cada instante de su trayectoria. Esta velocidad puede calcularse a\r\npartir de la velocidad media por un proceso de límites, para ello, consideremos\r\nel movimiento de una partícula a lo largo de la trayectoria\' de la figura.</span></p><p class=\"MsoNormal\" style=\"text-align: center; line-height: normal;\"><img src=\"data:image/png;base64,\" style=\"width: 238px;\" data-filename=\"9.png\"><br></p><p class=\"MsoNormal\" style=\"line-height:normal\"><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal\"><v:shape id=\"Imagen_x0020_18\" o:spid=\"_x0000_i1039\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:178.5pt;height:150.75pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image007.png\" o:title=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"23302f\" cropbottom=\"21621f\" cropleft=\"30920f\" cropright=\"20837f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:normal\"><span lang=\"ES\">Para tener mayor exactitud, elijamos un punto más cercano a P, digamos Q\',\r\nen 2 estas circunstancias el desplazamiento neto es </span><span lang=\"ES\" style=\"font-family:&quot;Cambria&quot;,serif;mso-bidi-font-family:Cambria;mso-ansi-language:\r\nES\">Δ</span><span lang=\"ES\">r\'= r2\'—r1 y el tiempo\r\ntranscurrido </span><span lang=\"ES\" style=\"font-family:&quot;Cambria&quot;,serif;\r\nmso-bidi-font-family:Cambria;mso-ansi-language:ES\">Δ</span><span lang=\"ES\">t\'= t2\'- t1 , luego la velocidad media pata los\r\npuntos P y Q es:</span></p><p class=\"MsoNormal\" style=\"text-align: center; line-height: normal;\"><img src=\"data:image/png;base64,\" style=\"width: 196px;\" data-filename=\"10.png\"><br></p><p class=\"MsoNormal\" style=\"line-height:normal\"><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal\"><v:shape id=\"Imagen_x0020_19\" o:spid=\"_x0000_i1038\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:147pt;height:44.25pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image008.png\" o:title=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"44214f\" cropbottom=\"15646f\" cropleft=\"20585f\" cropright=\"34364f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:normal\"><span lang=\"ES\">Podemos elegir todavía un punto Q\" que esté mucho más cerca a P,\r\nentonces el desplazamiento neto es </span><span lang=\"ES\" style=\"font-family:\r\n&quot;Cambria&quot;,serif;mso-bidi-font-family:Cambria;mso-ansi-language:ES\">Δ</span><span lang=\"ES\">r\" y el tiempo transcurrido </span><span lang=\"ES\" style=\"font-family:&quot;Cambria&quot;,serif;mso-bidi-font-family:Cambria;\r\nmso-ansi-language:ES\">Δ</span><span lang=\"ES\">t”, y\r\nla velocidad media resulta:<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:normal\"><v:shape id=\"Imagen_x0020_20\" o:spid=\"_x0000_s1029\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" style=\"position:absolute;margin-left:172.8pt;margin-top:0;width:122pt;\r\n height:37.8pt;z-index:251660288;visibility:visible;mso-wrap-style:square;\r\n mso-wrap-distance-left:9pt;mso-wrap-distance-top:0;mso-wrap-distance-right:9pt;\r\n mso-wrap-distance-bottom:0;mso-position-horizontal:absolute;\r\n mso-position-horizontal-relative:text;mso-position-vertical:absolute;\r\n mso-position-vertical-relative:text\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image009.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" croptop=\"34653f\" cropbottom=\"25654f\" cropleft=\"22350f\" cropright=\"33692f\">\r\n <w:wrap type=\"square\">\r\n</w:wrap></v:imagedata></v:shape></p><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" style=\"width: 163px;\" data-filename=\"11.png\"><br></div><span lang=\"ES\">\r\n<o:p></o:p></span><p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:normal\"><span lang=\"ES\">En el límite, cuando el tiempo transcurrido tiende d cero,\r\nlo que se simboliza por</span><span lang=\"ES\" style=\"font-family:&quot;Cambria&quot;,serif;\r\nmso-bidi-font-family:Cambria;mso-ansi-language:ES\"> Δ</span><span lang=\"ES\">t-&gt; 0, la\r\nvelocidad media se constituye en la velocidad instantánea en el punto P para el\r\ninstante ti</span></p><p class=\"MsoNormal\" style=\"text-align: center; line-height: normal;\"><img src=\"data:image/png;base64,\" style=\"width: 156px;\" data-filename=\"12.png\"><br></p><p class=\"MsoNormal\" style=\"line-height:normal\"><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal\"><v:shape id=\"Imagen_x0020_21\" o:spid=\"_x0000_i1037\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" style=\"width:120.75pt;height:43.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image009.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" croptop=\"51533f\" cropbottom=\"8626f\" cropleft=\"21593f\" cropright=\"35625f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Usando la\r\nnotación de cálculo diferencial, el valor límite al que tiende el cociente </span><span lang=\"ES\" style=\"font-family:&quot;Cambria&quot;,serif;mso-bidi-font-family:Cambria;\r\nmso-ansi-language:ES\">Δ</span><span lang=\"ES\">r/ </span><span lang=\"ES\" style=\"font-family:&quot;Cambria&quot;,serif;mso-bidi-font-family:Cambria;\r\nmso-ansi-language:ES\">Δ</span><span lang=\"ES\">t &nbsp;cuando </span><span lang=\"ES\" style=\"font-family:\r\n&quot;Cambria&quot;,serif;mso-bidi-font-family:Cambria;mso-ansi-language:ES\">Δ</span><span lang=\"ES\">t tiende a cero, se escribe como dr/dt.</span></p><p class=\"MsoNormal\" style=\"text-align: center; \"><img src=\"data:image/png;base64,\" style=\"width: 176px;\" data-filename=\"13.png\"><span lang=\"ES\"><br></span></p>\r\n\r\n<p class=\"MsoNormal\"><b>VELOCIDAD\r\nPROMEDIO<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Es la media\r\naritmética de un conjunto de velocidades diferentes, se calcula con la\r\necuación:</span></p><p class=\"MsoNormal\" style=\"text-align: center; \"><img src=\"data:image/png;base64,\" style=\"width: 302px;\" data-filename=\"14.png\"><br></p><p class=\"MsoNormal\"><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_23\" o:spid=\"_x0000_i1035\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:227.25pt;height:61.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image011.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"26439f\" cropbottom=\"31480f\" cropleft=\"21341f\" cropright=\"29659f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<h4 style=\"margin-bottom:7.95pt;line-height:107%\"><b><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%\">MOVIMIENTO RECTILÍNEO<o:p></o:p></span></b></h4>\r\n\r\n<p class=\"MsoNormal\"><b>MOVIMIENTO\r\nRECTILÍNEO UNIFORME<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">El movimiento más\r\nsimple que podemos encontrar en la naturaleza, es un movimiento en línea recta\r\ny con velocidad constante, esto significa que en intervalos de tiempos iguales\r\nrecorre distancias también iguales.<b><i><o:p></o:p></i></b></span></p>\r\n\r\n<p class=\"MsoNormal\"><b><span lang=\"ES\" style=\"font-size:10.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:107%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-ansi-language:ES\">ECUACIONES DEL MOVIMIENTO RECTILÍNEO\r\nUNIFORME<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span lang=\"ES\" style=\"font-size:9.0pt;mso-bidi-font-size:11.0pt;line-height:107%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:\r\nES\">Consideremos un vehículo moviéndose con velocidad constante sobre el eje x.\r\nEn el instante inicial ti el móvil se encuentra a una distancia x1 del origen O\r\ny su vector posición es r1</span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><img src=\"data:image/png;base64,\" style=\"width: 386px;\" data-filename=\"15.png\"><span lang=\"ES\" style=\"font-size:9.0pt;mso-bidi-font-size:11.0pt;line-height:107%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:\r\nES\"><br></span><v:shape id=\"Imagen_x0020_24\" o:spid=\"_x0000_i1034\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente con confianza media\" style=\"width:289.5pt;height:129.75pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image012.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente con confianza media\" croptop=\"27036f\" cropbottom=\"19978f\" cropleft=\"21089f\" cropright=\"21089f\">\r\n</v:imagedata></v:shape><span lang=\"ES\" style=\"font-size:9.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-ansi-language:ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Si la velocidad del móvil permanece constante, entonces, las velocidades\r\ninstantánea y media son iguales:<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span lang=\"ES\" style=\"font-size:9.0pt;mso-bidi-font-size:11.0pt;line-height:107%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:\r\nES\">.</span><span lang=\"ES\"> <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><img src=\"data:image/png;base64,\" style=\"width: 196px;\" data-filename=\"16.png\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_27\" o:spid=\"_x0000_i1033\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" style=\"width:147pt;height:40.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image013.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" croptop=\"21211f\" cropbottom=\"38649f\" cropleft=\"21509f\" cropright=\"32516f\">\r\n</v:imagedata></v:shape><b><i><o:p></o:p></i></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:24.95pt;margin-bottom:\r\n16.0pt;margin-left:5.9pt;text-align:justify;text-indent:-.15pt\"><span lang=\"ES\" style=\"font-size:9.0pt;mso-bidi-font-size:11.0pt;line-height:107%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:\r\nES\">Donde el módulo de es x2 , y el de , XI , luego:</span><span lang=\"ES\"> <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-top:0cm;margin-right:24.95pt;\r\nmargin-bottom:16.0pt;margin-left:5.9pt;text-align:center;text-indent:-.15pt\"><v:shape id=\"Imagen_x0020_28\" o:spid=\"_x0000_i1032\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" style=\"width:83.25pt;height:46.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image014.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" croptop=\"26737f\" cropbottom=\"32077f\" cropleft=\"21385f\" cropright=\"37362f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_29\" o:spid=\"_x0000_i1031\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" style=\"width:70.5pt;height:29.25pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image014.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" croptop=\"38782f\" cropbottom=\"22518f\" cropleft=\"21846f\" cropright=\"37809f\">\r\n</v:imagedata></v:shape><b><i><o:p></o:p></i></b></p>\r\n\r\n<p class=\"MsoNormal\"><b>&nbsp;</b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: center; \"><b>&nbsp;</b><img src=\"data:image/png;base64,\" style=\"width: 112px;\" data-filename=\"17.png\"></p><p class=\"MsoNormal\" style=\"text-align: center; \"><img src=\"data:image/png;base64,\" style=\"width: 101px;\" data-filename=\"18.png\"><br></p>\r\n\r\n<p class=\"MsoNormal\"><b>&nbsp;</b></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"font-size: 0.875rem;\">MOVIMIENTO\r\nRECTILÍNEO VARIADO</b><br></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Cuando observamos\r\nla caída de un objeto desde una cierta altura y a partir del reposo, notamos\r\nque para un tiempo cero, su velocidad es también cero, pero esta velocidad se\r\nincrementa conforme el objeto se acerca al suelo, Este movimiento es variado\r\nporque la velocidad cambia con el tiempo. Movimiento variado es también el que\r\nocurre cuando un vehículo moviéndose en una avenida debe detenerse al llegar\r\nfrente a un semáforo, el conductor aplica los frenos y el vehículo que\r\ninicialmente poseía una cierta velocidad: al cabo de un corto tiempo se\r\ndetiene.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">De este modo, el\r\nmovimiento de una partícula es variado cuando su velocidad cambia al\r\ntranscurrir el tiempo, decimos entonces que la partícula posee aceleración<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b>ACELERACIÓN<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Es la rapidez con\r\nque una partícula cambia su velocidad al transcurrir el tiempo. Este cambio\r\npuede ser positivo o negativo; en el primer caso, la velocidad aumenta y el\r\nmovimiento se llama acelerado, mientras que en el segundo, la velocidad\r\ndisminuye y el movimiento es desacelerado o decelerado <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b>ACELERACIÓN\r\nMEDIA (a)<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Es el cociente\r\nentre el cambio neto de velocidad y el tiempo transcurrido durante ese cambio\r\nde velocidades. Para encontrar la ecuación de la aceleración media consideremos\r\nla figura</span></p><p class=\"MsoNormal\" style=\"text-align: center; \"><img src=\"data:image/png;base64,\" style=\"width: 432px;\" data-filename=\"19.png\"><br></p><p class=\"MsoNormal\"><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_7\" o:spid=\"_x0000_i1030\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:324pt;height:92.25pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image015.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"41973f\" cropbottom=\"9373f\" cropleft=\"17224f\" cropright=\"20333f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">La figura (a)\r\nmuestra que en el tiempo ti, el móvil está a una distancia XI a partir del\r\norigen O y posee una velocidad v, , para el tiempo t2 , su posición es x2 y su\r\nvelocidad v2 Entonces, el cambio neto de velocidad , como se observa en la\r\nfigura (b), es </span><span lang=\"ES\" style=\"font-family:&quot;Cambria&quot;,serif;\r\nmso-bidi-font-family:Cambria;mso-ansi-language:ES\">Δ</span><span lang=\"ES\">v = v 2 —VI y el tiempo transcurrido </span><span lang=\"ES\" style=\"font-family:&quot;Cambria&quot;,serif;mso-bidi-font-family:Cambria;\r\nmso-ansi-language:ES\">Δ</span><span lang=\"ES\">t — t2\r\ntl , Luego la aceleración media es:</span></p><p class=\"MsoNormal\" style=\"text-align: center; \"><img src=\"data:image/png;base64,\" style=\"width: 196px;\" data-filename=\"16.png\"><br></p><p class=\"MsoNormal\"><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_9\" o:spid=\"_x0000_i1029\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:129.75pt;height:44.25pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image016.png\" o:title=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"17924f\" cropbottom=\"41189f\" cropleft=\"22097f\" cropright=\"32852f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Cuyas unidades en\r\nel sistema internacional son:<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Imagen_x0020_25\" o:spid=\"_x0000_s1028\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" style=\"position:absolute;margin-left:180.6pt;margin-top:22.8pt;width:142.2pt;\r\n height:64.8pt;z-index:251658752;visibility:visible;mso-wrap-style:square;\r\n mso-wrap-distance-left:9pt;mso-wrap-distance-top:0;mso-wrap-distance-right:9pt;\r\n mso-wrap-distance-bottom:0;mso-position-horizontal:absolute;\r\n mso-position-horizontal-relative:text;mso-position-vertical:absolute;\r\n mso-position-vertical-relative:text\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image016.png\" o:title=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"27484f\" cropbottom=\"27297f\" cropleft=\"22686f\" cropright=\"29575f\">\r\n <w:wrap type=\"square\">\r\n</w:wrap></v:imagedata></v:shape><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" data-filename=\"22.png\" style=\"font-size: 0.875rem; width: 330px;\"></div></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_30\" o:spid=\"_x0000_i1028\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:247.5pt;height:50.25pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image016.png\" o:title=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"41824f\" cropbottom=\"17290f\" cropleft=\"24786f\" cropright=\"23021f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b>ACELERACIÓN\r\nINSTANTÁNEA (a)<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Es la aceleración\r\nque posee una partícula en un punto y en un instante determinado. Esta\r\naceleración, de manera parecida a la velocidad instantánea, se obtiene a partir\r\nde la aceleración media por un proceso de límites.</span></p><p class=\"MsoNormal\" style=\"text-align: center; \"><img src=\"data:image/png;base64,\" style=\"width: 236px;\" data-filename=\"23.png\"><br></p><p class=\"MsoNormal\"><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_31\" o:spid=\"_x0000_i1027\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" style=\"width:177pt;height:37.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image017.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" croptop=\"40031f\" cropbottom=\"19979f\" cropleft=\"21761f\" cropright=\"28987f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">la aceleración\r\nse&nbsp; expresa como la segunda derivada de\r\nla posición respecto del tiempo<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_336064\" o:spid=\"_x0000_i1026\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" style=\"width:108pt;height:41.25pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image018.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" croptop=\"52428f\" cropbottom=\"7432f\" cropleft=\"21677f\" cropright=\"35541f\">\r\n</v:imagedata></v:shape><img src=\"data:image/png;base64,\" style=\"width: 144px;\" data-filename=\"25.png\"><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">MOVIMIENTO\r\nUNIFORMEMENTE VARIADO (m.u.v.)<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Al igual que la\r\nvelocidad, la aceleración puede permanecer constante durante todo el trayecto,\r\ncaso el movimiento se llama uniformemente variado o acelerado, o cambiar de\r\nforma aleatoria, teniéndose en este caso un movimiento con aceleración variable<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-size:10.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:107%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-ansi-language:ES\">ECUACIONES DEL MOVIMIENTO UNIFORMEMENTE\r\nVARIADO O ACELERADO</span><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Al inicio de este\r\ncapítulo mencionamos que la cinemática busca ecuaciones que relacionen las\r\nvariables de movimiento: desplazamiento x, velocidad v, aceleración a, tiempo\r\nt. En este acápite desarrollaremos tales ecuaciones.</span></p><p class=\"MsoNormal\" style=\"text-align: center; \"><img src=\"data:image/png;base64,\" style=\"width: 334px;\" data-filename=\"26.png\"><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_336072\" o:spid=\"_x0000_i1025\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Tabla\r\n\r\nDescripción generada automáticamente con confianza media\" style=\"width:250.5pt;height:222pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image019.png\" o:title=\"Interfaz de usuario gráfica, Tabla\r\n\r\nDescripción generada automáticamente con confianza media\" croptop=\"18273f\" cropbottom=\"14284f\" cropleft=\"17369f\" cropright=\"27249f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span lang=\"ES\">&nbsp;</span></p>', '2021-11-12 18:19:30', '2021-11-12 19:03:36');
INSERT INTO `introduccions` (`id`, `seccion`, `contenido`, `created_at`, `updated_at`) VALUES
(3, 'Caída libre', '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><b><span lang=\"ES\" style=\"font-size:20.0pt;line-height:107%;mso-ansi-language:ES\">CAIDA LIBRE<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Todos los cuerpos\r\nque se encuentran sobre la tierra están sujetos a la atracción que nuestro\r\nplaneta ejerce. Entonces, si soltamos un objeto a cierta altura del suelo,\r\nInmediatamente caerá hacia el piso, este hecho se debe justamente a las fuerzas\r\nde atracción entre la tierra y dicho objeto.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Observaremos también,\r\nque a medida que el objeto se acerca al suelo, su velocidad va&amp;en aumento;\r\nesto quiere decir que el movimiento de los cuerpos debido a la atracción\r\nterrestre es un movimiento variado.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">ECUACIONES DEL\r\nMOVIMIENTO EN CAÍDA LIBRE<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">La ecuaciones que\r\ndescriben el movimiento de caída libre, son las mismas que se dedujeron para el\r\nmovimiento rectilíneo&nbsp; uniformemente\r\nacelerado, en ellas, es suficiente cambiar la aceleración “A” por “g” considerando\r\nque tanto sin embargo las velocidades tanto como la aceleración son vectores y\r\nel sentido de estos debe señalarse mediante los signos “+” y “-“&nbsp; de acuerdo la conveniencia&nbsp; de sus ejemplos. por ejemplo, las ecuaciones\r\nde caída libre para los siguientes casos pueden ser:</span></p><p class=\"MsoNormal\" style=\"text-align: center; \"><img src=\"data:image/png;base64,\" style=\"width: 394px;\" data-filename=\"Sin 1.png\"><br></p><p class=\"MsoNormal\"><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><v:shapetype id=\"_x0000_t75\" coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\" path=\"m@4@5l@4@11@9@11@9@5xe\" filled=\"f\" stroked=\"f\">\r\n <v:stroke joinstyle=\"miter\">\r\n <v:formulas>\r\n  <v:f eqn=\"if lineDrawn pixelLineWidth 0\">\r\n  <v:f eqn=\"sum @0 1 0\">\r\n  <v:f eqn=\"sum 0 0 @1\">\r\n  <v:f eqn=\"prod @2 1 2\">\r\n  <v:f eqn=\"prod @3 21600 pixelWidth\">\r\n  <v:f eqn=\"prod @3 21600 pixelHeight\">\r\n  <v:f eqn=\"sum @0 0 1\">\r\n  <v:f eqn=\"prod @6 1 2\">\r\n  <v:f eqn=\"prod @7 21600 pixelWidth\">\r\n  <v:f eqn=\"sum @8 21600 0\">\r\n  <v:f eqn=\"prod @7 21600 pixelHeight\">\r\n  <v:f eqn=\"sum @10 21600 0\">\r\n </v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:formulas>\r\n <v:path o:extrusionok=\"f\" gradientshapeok=\"t\" o:connecttype=\"rect\">\r\n <o:lock v:ext=\"edit\" aspectratio=\"t\">\r\n</o:lock></v:path></v:stroke></v:shapetype><v:shape id=\"Imagen_x0020_336073\" o:spid=\"_x0000_i1026\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:295.5pt;\r\n height:201.75pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image001.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"23708f\" cropbottom=\"14423f\" cropleft=\"17369f\" cropright=\"26981f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b>MOVIMIENTO EN\r\nPLANO<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Hasta aquí hemos\r\nestudiado el movimiento horizontal, eje x, y el movimiento vertical, eje y, por\r\nseparado. En esta sección estudiaremos el movimiento en el plano x-y, que es un\r\nmovimiento combinado de los ejes \"x\" y \"y\"; en otras\r\npalabras, estudiaremos el movimiento en dos dimensiones.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b>ECUACIONES DEL\r\nMOVIMIENTO EN EL PLANO</b></p><p class=\"MsoNormal\"><br></p><p class=\"MsoNormal\" style=\"text-align: center; \"><img src=\"data:image/png;base64,\" style=\"width: 338px;\" data-filename=\"2.png\"><b><o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_336074\" o:spid=\"_x0000_i1025\" type=\"#_x0000_t75\" alt=\"Tabla\r\n\r\nDescripción generada automáticamente\" style=\"width:253.5pt;height:111pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image002.png\" o:title=\"Tabla\r\n\r\nDescripción generada automáticamente\" croptop=\"30066f\" cropbottom=\"10255f\" cropleft=\"16783f\" cropright=\"22913f\">\r\n</v:imagedata></v:shape><b><o:p></o:p></b></p>', '2021-11-12 18:19:30', '2021-11-12 19:06:06');
INSERT INTO `introduccions` (`id`, `seccion`, `contenido`, `created_at`, `updated_at`) VALUES
(4, 'Movimiento parabólico', '<p></p><div class=\"WordSection1\">\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><b><span lang=\"ES\" style=\"font-size:20.0pt;line-height:107%;mso-ansi-language:ES\">MOVIMIENTO\r\nPARABOLICO<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">El movimiento\r\nparabólico, que es un caso particular del movimiento en el plano, comprende\r\nsituaciones tales como: disparo de una bala por un cañón, movimiento de un\r\ncohete luego de agotarse su combustible, lanzamiento de una pelota en un juego\r\nde fútbol o voleibol, chorros de agua lanzados por mangueras, etc. La pelota,\r\nuna vez que ha abandonado la mano del lanzador, o la bala, luego de abandonar\r\nla boca del cañón, se mueve por la velocidad inicial proporcionada y la acción\r\nde la fuerza gravitatoria.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Si consideramos\r\ndespreciable la resistencia del aire, en el eje horizontal el proyectil se\r\nmoverá con movimiento uniforme, esto es, ax = 0, mientras que en el eje vertical,\r\nlo hará con movimiento uniformemente acelerado, donde la aceleración constante\r\nes la gravedad \"g\" Ahora bien, respecto de un sistema de coordenadas\r\nelegido en el punto donde el proyectil es disparado (boca del cañón), y con el\r\neje \"y\" positivo hacia arriba, la aceleración de la gravedad es\r\nnegativa cuando el proyectil se mueve hacia arriba y positiva cuando lo hace\r\nhacia abajo, es decir, ay = +g<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">De acuerdo a lo\r\nexpuesto, las ecuaciones para el moviente parabólico se presenta en la tabla:</span></p><p class=\"MsoNormal\" style=\"text-align: center; \"><img src=\"data:image/png;base64,\" style=\"width: 283px;\" data-filename=\"1.png\"><br></p><p class=\"MsoNormal\"><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shapetype id