clip_image002.png\" o:title=\"Imagen que contiene Diagrama\r\n\r\nDescripción generada automáticamente\" croptop=\"27526f\" cropbottom=\"13150f\" cropleft=\"19192f\" cropright=\"22799f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: center; \"><span lang=\"ES\">&nbsp;</span><img src=\"data:image/png;base64,\" style=\"width: 309px;\" data-filename=\"2.png\"></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoListParagraph\" style=\"text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"ES\" style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;mso-ansi-language:ES\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:10.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:107%;mso-ascii-font-family:Calibri;mso-fareast-font-family:\r\nCalibri;mso-hansi-font-family:Calibri;mso-bidi-font-family:Calibri\">Altura\r\nmáxima (ymax)</span><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.7pt;margin-bottom:9.7pt;\r\nmargin-left:18.0pt;text-align:justify;line-height:108%\"><span lang=\"ES\" style=\"font-size:9.0pt;mso-bidi-font-size:11.0pt;line-height:108%;mso-ascii-font-family:\r\nCalibri;mso-fareast-font-family:Calibri;mso-hansi-font-family:Calibri;\r\nmso-bidi-font-family:Calibri;mso-ansi-language:ES\">Es la máxima distancia que\r\nalcanza el proyectil en el eje y. Esta altura se calcula planteando la ecuación</span><span lang=\"ES\"> </span><span lang=\"ES\" style=\"font-size:9.0pt;mso-bidi-font-size:11.0pt;line-height:108%;mso-ascii-font-family:\r\nCalibri;mso-fareast-font-family:Calibri;mso-hansi-font-family:Calibri;\