pe=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:115.5pt;height:36.75pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image008.png\" o:title=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"21972f\" cropbottom=\"38938f\" cropleft=\"22441f\" cropright=\"34961f\">\r\n</v:imagedata></v:shape>&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<v:shape id=\"Imagen_x0020_336080\" o:spid=\"_x0000_i1027\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:87.75pt;height:26.25pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image008.png\" o:title=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"30067f\" cropbottom=\"31305f\" cropleft=\"22441f\" cropright=\"35157f\">\r\n</v:imagedata></v:shape><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Imagen_x0020_336081\" o:spid=\"_x0000_i1026\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:165.75pt;height:99pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image008.png\" o:title=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"37005f\" cropbottom=\"13843f\" cropleft=\"22052f\" cropright=\"29693f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Imagen_x0020_336082\" o:spid=\"_x0000_i1025\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:135pt;height:39.75pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image009.png\" o:title=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"16191f\" cropbottom=\"42522f\" cropleft=\"24393f\" cropright=\"28198f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p><p></p>', '2021-11-12 18:19:30', '2021-11-12 19:14:21');
INSERT INTO `introduccions` (`id`, `seccion`, `contenido`, `created_at`, `updated_at`) VALUES
(5, 'Gravitación universal', '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><b><span lang=\"ES\" style=\"font-size:24.0pt;line-height:107%;mso-ansi-language:ES;mso-no-proof:\r\nyes\">GRAVITACION UNIVERSAL<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">La\r\nley de la gravitación universal, o simplemente, ley de la gravedad, establece\r\nla fuerza con la que se atraen dos cuerpos por el simple hecho de tener masa.\r\nEsta ley fue desarrollada por Sir Isaac Newton.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b>Fuerza de la gravedad<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">La\r\nexpresión de la ley de gravitación universal se plasma en la expresión de la\r\nfuerza gravitatoria o fuerza de la gravedad<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Dos\r\ncuerpos se atraen con una fuerza directamente proporcional al producto de sus\r\nmasas e inversamente proporcional al cuadrado de la distancia que las separa, y\r\nestá dirigida según la recta que une los cuerpos. Dicha fuerza se conoce como\r\nfuerza de la gravedad o fuerza gravitacional y se expresa de la forma:<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shapetype id=\"_x0000_t75\" coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\" path=\"m@4@5l@4@11@9@11@9@5xe\" filled=\"f\" stroked=\"f\">\r\n <v:stroke joinstyle=\"miter\">\r\n <v:formulas>\r\n  <v:f eqn=\"if lineDrawn pixelLineWidth 0\">\r\n  <v:f eqn=\"sum @0 1 0\">\r\n  <v:f eqn=\"sum 0 0 @1\">\r\n  <v:f eqn=\"prod @2 1 2\">\r\n  <v:f eqn=\"prod @3 21600 pixelWidth\">\r\n  <v:f eqn=\"prod @3 21600 pixelHeight\">\r\n  <v:f eqn=\"sum @0 0 1\">\r\n  <v:f eqn=\"prod @6 1 2\">\r\n  <v:f eqn=\"prod @7 21600 pixelWidth\">\r\n  <v:f eqn=\"sum @8 21600 0\">\r\n  <v:f eqn=\"prod @7 21600 pixelHeight\">\r\n  <v:f eqn=\"sum @10 21600 0\">\r\n </v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:formulas>\r\n <v:path o:extrusionok=\"f\" gradientshapeok=\"t\" o:connecttype=\"rect\">\r\n <o:lock v:ext=\"edit\" aspectratio=\"t\">\r\n</o:lock></v:path></v:stroke></v:shapetype><v:shape id=\"Imagen_x0020_192929\" o:spid=\"_x0000_i1033\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:132.75pt;height:48.75pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image001.png\" o:title=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"38468f\" cropbottom=\"20632f\" cropleft=\"24999f\" cropright=\"30668f\">\r\n</v:imagedata></v:shape><span lang=\"ES\" style=\"font-family: Arial, sans-serif; color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:ES\">donde:<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:ES\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"ES\" style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;mso-ansi-language:ES\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"ES\" style=\"font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:ES\">F→g: Es el\r\nvector fuerza gravitatoria. Su unidad de medida en el Sistema Internacional es\r\nel newton (N)<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"ES\" style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;mso-ansi-language:ES\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"ES\" style=\"font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:ES\">G es la\r\nconstante de gravitación universal, que no depende de los cuerpos que\r\ninteraccionan y cuyo valor es G = 6,67·10-11 N·m2/kg2, <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"ES\" style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;mso-ansi-language:ES\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"ES\" style=\"font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:ES\">M y m son las\r\nmasas de los cuerpos que interaccionan. Su unidad de medida en el Sistema\r\nInternacional (S.I.) es el kilogramo (kg)<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"ES\" style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;mso-ansi-language:ES\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"ES\" style=\"font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:ES\">r es la\r\ndistancia que los separa. Es el módulo del vector r→ , que une la masa que\r\ngenera la fuerza con la masa sobre la que actúa.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"ES\" style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;mso-ansi-language:ES\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><v:shape id=\"Imagen_x0020_192930\" o:spid=\"_x0000_s1026\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación, Chat o mensaje de texto\r\n\r\nDescripción generada automáticamente\" style=\"position: absolute; left: 0px; margin-left: 48pt; margin-top: 0.45pt; width: 21.75pt; height: 17.25pt; z-index: 251684864; visibility: visible;\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image002.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación, Chat o mensaje de texto\r\n\r\nDescripción generada automáticamente\" croptop=\"46118f\" cropbottom=\"16431f\" cropleft=\"16541f\" cropright=\"47629f\">\r\n <w:wrap type=\"through\">\r\n</w:wrap></v:imagedata></v:shape><span lang=\"ES\" style=\"font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-ansi-language:ES\">&nbsp;&nbsp;&nbsp;&nbsp;es un vector unitario que posee la misma\r\ndirección de actuación de la fuerza, aunque de sentido contrario.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:18.0pt\"><span lang=\"ES\">Por tanto, la interacción gravitatoria entre dos cuerpos\r\nsiempre se manifiesta como una pareja de fuerzas iguales en dirección y módulo\r\npero sentido contrario. El caracter atractivo de la fuerza se indica mediante\r\nel signo - de la expresión anterior. La siguiente imagen ilustra este concepto.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:18.0pt;text-align:center\"><v:shape id=\"Imagen_x0020_192931\" o:spid=\"_x0000_i1032\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Aplicación\r\n\r\nDescripción generada automáticamente\" style=\"width:164.25pt;height:54pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image003.png\" o:title=\"Interfaz de usuario gráfica, Aplicación\r\n\r\nDescripción generada automáticamente\" croptop=\"23250f\" cropbottom=\"31088f\" cropleft=\"20589f\" cropright=\"25836f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:18.0pt\"><b>Fuerza Gravitacional<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">La\r\nsegunda masa (m2) es la responsable de aparezca una fuerza de atracción sobre\r\nel primer cuerpo (m1) denominada F→2,1. Este a su vez también es el responsable\r\nde que aparezca una fuerza de atracción denominada F→1,2 sobre el cuerpo\r\nm1.&nbsp; Ambas fuerzas son de igual dirección\r\naunque de sentido contrario. Vectorialmente podemos expresar esto:<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_192932\" o:spid=\"_x0000_i1031\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" style=\"width:153pt;height:34.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image004.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" croptop=\"32024f\" cropbottom=\"27633f\" cropleft=\"22793f\" cropright=\"28304f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b>La fuerza gravitatoria depende de la distancia<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Sabemos\r\nque la aceleración centrípeta es la responsable del movimiento circular de la\r\nTierra alrededor del Sol. Dicha aceleración se genera gracias a la fuerza\r\ncentrípeta, que en este caso, es precisamente la fuerza gravitatoria. Por\r\ntanto, teniendo esto en cuenta y a partir del principio fundamental, podemos\r\nescribir:<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_192933\" o:spid=\"_x0000_i1030\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" style=\"width:128.25pt;height:40.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image005.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" croptop=\"47798f\" cropbottom=\"12510f\" cropleft=\"25364f\" cropright=\"30981f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">A\r\npartir de las observaciones de Kepler y su tercera ley T2=k</span><span lang=\"ES\" style=\"font-family:&quot;Cambria Math&quot;,serif;mso-bidi-font-family:&quot;Cambria Math&quot;;\r\nmso-ansi-language:ES;mso-no-proof:yes\">⋅</span><span lang=\"ES\">r3 , y sustituyendo la aceleraci</span><span lang=\"ES\">ó</span><span lang=\"ES\">n centrípeta en la expresión de\r\nla fuerza correspondiente anterior, podemos escribir:<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_192935\" o:spid=\"_x0000_i1029\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" style=\"width:309.75pt;height:46.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image006.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" croptop=\"45371f\" cropbottom=\"13630f\" cropleft=\"16961f\" cropright=\"24051f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b>La fuerza gravitatoria depende de la masa<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span lang=\"ES\">la constante k\' anterior, debe\r\nser, a su vez, proporcional a la masa del planeta Sol, quedando finalmente: </span><v:shape id=\"Imagen_x0020_192936\" o:spid=\"_x0000_i1028\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" style=\"width:247.5pt;height:57pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image007.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" croptop=\"45838f\" cropbottom=\"11390f\" cropleft=\"16227f\" cropright=\"28987f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">La\r\nexpresión anterior determina la fuerza con la que se atraen dos masas\r\ncualesquiera por el simple hecho de tener materia. La constante G es una\r\nconstante de proporcionalidad independiente, esta vez, de ambas masas.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">La\r\ntercera ley de Kepler establece la relación entre el periodo de un planeta\r\nalrededor del Sol y su radio medio a través de la constante k según la\r\nexpresión T2=k</span><span lang=\"ES\" style=\"font-family:&quot;Cambria Math&quot;,serif;\r\nmso-bidi-font-family:&quot;Cambria Math&quot;;mso-ansi-language:ES;mso-no-proof:yes\">⋅</span><span lang=\"ES\">r3 . Kepler supuso que la\r\nrazón del movimiento plantario residía en el Sol. A partir de la expresión de\r\nla fuerza gravitacional, podemos comprobar que no le faltaba razón.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b>Significado físico de la constante de Kepler<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Según\r\nhemos hablado, la fuerza gravitacional es centrípeta, al ser la responsable de\r\nque el planeta, de masa mP gire en torno al Sol, de masa mS. Por tanto, podemos\r\nescribir:<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Imagen_x0020_192937\" o:spid=\"_x0000_i1027\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" style=\"width:341.25pt;height:54.75pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image008.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" croptop=\"19607f\" cropbottom=\"38276f\" cropleft=\"14127f\" cropright=\"24524f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"color: rgb(33, 37, 41); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Como sabemos que&nbsp;</span><span class=\"mi\"><span style=\"color: rgb(33, 37, 41); border: 1pt none windowtext; padding: 0cm; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">ω</span></span><span class=\"mo\"><span lang=\"ES\" style=\"color: rgb(33, 37, 41); border: 1pt none windowtext; padding: 0cm; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">=</span></span><span class=\"mn\"><span lang=\"ES\" style=\"color: rgb(33, 37, 41); border: 1pt none windowtext; padding: 0cm; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">2</span></span><span class=\"mi\"><span style=\"color: rgb(33, 37, 41); border: 1pt none windowtext; padding: 0cm; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">π</span></span><span class=\"mi\"><span lang=\"ES\" style=\"color: rgb(33, 37, 41); border: 1pt none windowtext; padding: 0cm; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">/T</span></span><span lang=\"ES\" style=\"color: rgb(33, 37, 41); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">, podemos despejar de la siguiente\r\nforma:<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_192938\" o:spid=\"_x0000_i1026\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" style=\"width:228.75pt;height:41.25pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image008.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" croptop=\"34547f\" cropbottom=\"24739f\" cropleft=\"20168f\" cropright=\"26047f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">La\r\nexpresión anterior es, precisamente, la tercera ley de Kepler, considerando:<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_192939\" o:spid=\"_x0000_i1025\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" style=\"width:89.25pt;height:45pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image008.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" croptop=\"47238f\" cropbottom=\"11762f\" cropleft=\"26729f\" cropright=\"31613f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<h4 style=\"background:#F7F7F7\"><span lang=\"ES\"><a href=\"https://www.fisicalab.com/nosotros\"><b><i><span style=\"font-size:9.0pt;\r\nline-height:110%;font-family:&quot;Open Sans&quot;,sans-serif;color:#0088CC\">José L.\r\nFernández</span></i></b></a></span><span class=\"author-name\"><b><i><span lang=\"ES\" style=\"font-size:9.0pt;line-height:110%;font-family:&quot;Open Sans&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-theme-font:major-fareast;\r\ncolor:#0088CC\">&nbsp;</span></i></b></span><i><span lang=\"ES\" style=\"font-size:\r\n9.0pt;line-height:110%;font-family:&quot;Open Sans&quot;,sans-serif;color:#212529\"><o:p></o:p></span></i></h4>\r\n\r\n<p class=\"MsoNormal\" style=\"background:#F7F7F7\"><i><span lang=\"ES\" style=\"font-size:9.0pt;line-height:107%;font-family:&quot;Open Sans&quot;,sans-serif;\r\ncolor:#212529;mso-ansi-language:ES\">José L. Fernández es ingeniero de\r\ntelecomunicaciones, profesor y curioso por naturaleza.<o:p></o:p></span></i></p>', '2021-11-12 18:19:30', '2021-11-12 19:14:53');
INSERT INTO `introduccions` (`id`, `seccion`, `contenido`, `created_at`, `updated_at`) VALUES
(6, 'Movimiento circular', '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><b><span lang=\"ES\" style=\"font-size:22.0pt;line-height:107%;mso-bidi-font-family:Calibri;\r\nmso-bidi-theme-font:minor-latin;mso-ansi-language:ES\">MOVIMIENTO CIRCULAR<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\"><b><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\">INTRIDUCCION<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\">En nuestra vida diaria, existe un sinnúmero de cuerpos que poseen un\r\nmovimiento circular;&nbsp; algunos ejemplos\r\nson: movimiento de ejes, poleas, discos, electrones alrededor del núcleo\r\natómico, inclusive, el movimiento de los planetas alrededor del sol puede simplificarse\r\nal caso&nbsp; de un movimiento circular.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\">Del mismo modo que el movimiento rectilíneo está referido a un eje, el\r\nmovimiento circular necesita también referirse a un eje, llamado por eso eje de\r\nrotación.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shapetype id=\"_x0000_t75\" coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\" path=\"m@4@5l@4@11@9@11@9@5xe\" filled=\"f\" stroked=\"f\">\r\n <v:stroke joinstyle=\"miter\">\r\n <v:formulas>\r\n  <v:f eqn=\"if lineDrawn pixelLineWidth 0\">\r\n  <v:f eqn=\"sum @0 1 0\">\r\n  <v:f eqn=\"sum 0 0 @1\">\r\n  <v:f eqn=\"prod @2 1 2\">\r\n  <v:f eqn=\"prod @3 21600 pixelWidth\">\r\n  <v:f eqn=\"prod @3 21600 pixelHeight\">\r\n  <v:f eqn=\"sum @0 0 1\">\r\n  <v:f eqn=\"prod @6 1 2\">\r\n  <v:f eqn=\"prod @7 21600 pixelWidth\">\r\n  <v:f eqn=\"sum @8 21600 0\">\r\n  <v:f eqn=\"prod @7 21600 pixelHeight\">\r\n  <v:f eqn=\"sum @10 21600 0\">\r\n </v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:formulas>\r\n <v:path o:extrusionok=\"f\" gradientshapeok=\"t\" o:connecttype=\"rect\">\r\n <o:lock v:ext=\"edit\" aspectratio=\"t\">\r\n</o:lock></v:path></v:stroke></v:shapetype><v:shape id=\"Imagen_x0020_336085\" o:spid=\"_x0000_i1061\" type=\"#_x0000_t75\" alt=\"Diagrama\r\n\r\nDescripción generada automáticamente\" style=\"width:223.5pt;\r\n height:87.75pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image001.png\" o:title=\"Diagrama\r\n\r\nDescripción generada automáticamente\" croptop=\"28797f\" cropbottom=\"20436f\" cropleft=\"21272f\" cropright=\"20913f\">\r\n</v:imagedata></v:shape><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\">DESPLAZAMIENTO ANGULAR<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\">En cinemática circular, la posición angular se indica mediante el radio de\r\ngiro R, y el ángulo barrido </span><span style=\"font-family: Arial, sans-serif; color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">θ</span><span lang=\"ES\" style=\"font-size:12.0pt;\r\nline-height:107%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;\r\nmso-ansi-language:ES\">. Así, la figura muestra que en un tiempo ti, la posición\r\nangular es </span><span style=\"font-family: Arial, sans-serif; color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">θ</span><span lang=\"ES\" style=\"font-size:12.0pt;line-height:\r\n107%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\">1(punto P), y para un instante posterior t2, la posición es </span><span style=\"font-family: Arial, sans-serif; color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">θ</span><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;mso-bidi-font-family:Calibri;\r\nmso-bidi-theme-font:minor-latin;mso-ansi-language:ES\">2 (punto Q). El\r\ndesplazamiento angular entre los tiempos t1 y t2 resulta entonces:<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Imagen_x0020_336070\" o:spid=\"_x0000_i1060\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica\r\n\r\nDescripción generada automáticamente\" style=\"width:129.75pt;height:144.75pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image002.png\" o:title=\"Interfaz de usuario gráfica\r\n\r\nDescripción generada automáticamente\" croptop=\"24602f\" cropbottom=\"19140f\" cropleft=\"37809f\" cropright=\"16704f\">\r\n</v:imagedata></v:shape><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\">&nbsp;&nbsp;&nbsp;&nbsp; </span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<v:shape id=\"Imagen_x0020_336086\" o:spid=\"_x0000_i1059\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica\r\n\r\nDescripción generada automáticamente\" style=\"width:108pt;height:40.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image002.png\" o:title=\"Interfaz de usuario gráfica\r\n\r\nDescripción generada automáticamente\" croptop=\"40734f\" cropbottom=\"19274f\" cropleft=\"16809f\" cropright=\"40491f\">\r\n</v:imagedata></v:shape><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Donde\r\n</span><span style=\"font-family: Arial, sans-serif; color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">θ</span><span lang=\"ES\" style=\"font-family: Arial, sans-serif; color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> se mide en radios <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\">En general, un ángulo en radianes se define como el cociente del arco S\r\nentre el radio R de la circunferencia, como se observa en la figura<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_336084\" o:spid=\"_x0000_i1058\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:261.75pt;height:121.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image003.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"23600f\" cropbottom=\"27745f\" cropleft=\"29323f\" cropright=\"18988f\">\r\n</v:imagedata></v:shape><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><v:shape id=\"Imagen_x0020_336087\" o:spid=\"_x0000_i1057\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:70.5pt;\r\n height:56.25pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image003.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"18671f\" cropbottom=\"41338f\" cropleft=\"17056f\" cropright=\"44530f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\">VELOCIDAD ANGULAR MEDIA E INSTANTÁNEA<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\">La velocidad angular media, es el cociente del desplazamiento angular neto,\r\n</span><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;font