n\r\nDescripción generada automáticamente\" style=\"width:141pt;height:39pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image004.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" croptop=\"25543f\" cropbottom=\"34317f\" cropleft=\"19493f\" cropright=\"34532f\">\r\n</v:imagedata></v:shape><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\">MOVIMIENTO CIRCULAR UNIFORME<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\">El movimiento es circular uniforme cuando una partícula describe ángulos\r\niguales en tiempos también iguales. Así, si la partícula emplea 3 segundos en\r\ndar una vuelta completa, la siguiente vuelta lo hará también en el mismo\r\ntiempo.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\">La ecuación que rige el movimiento circular uniforme se deduce considerando\r\nque, para este tipo de movimiento, las velocidades angulares media e\r\ninstantánea son iguales, entonces:&nbsp; <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_336090\" o:spid=\"_x0000_i1055\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" style=\"width:153pt;height:57.75pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image005.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" croptop=\"40479f\" cropbottom=\"18634f\" cropleft=\"20586f\" cropright=\"35372f\">\r\n</v:imagedata></v:shape><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\">Eligiendo la posición y tiempo iniciales iguales a cero: </span><span style=\"font-family: Arial, sans-serif; color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">θ</span><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;mso-bidi-font-family:Calibri;\r\nmso-bidi-theme-font:minor-latin;mso-ansi-language:ES\">1 = 0 y t1 = 0, los\r\nvalores finales </span><span style=\"font-family: Arial, sans-serif; color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">θ</span><span lang=\"ES\" style=\"font-size:12.0pt;line-height:\r\n107%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\">2 y t2 adoptan valores genéricos: </span><span style=\"font-family: Arial, sans-serif; color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">θ</span><span lang=\"ES\" style=\"font-size:12.0pt;\r\nline-height:107%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;\r\nmso-ansi-language:ES\"> y t. Entonces:<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_336091\" o:spid=\"_x0000_i1054\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" style=\"width:75pt;height:91.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image006.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" croptop=\"35251f\" cropbottom=\"17738f\" cropleft=\"20501f\" cropright=\"40666f\">\r\n</v:imagedata></v:shape><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\">PERIODO Y FRECUENCIA<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\">En el caso del movimiento circular uniforme, el movimiento es periódico, es\r\ndecir, la partícula completa un ciclo (una vuelta) siempre en el mismo tiempo.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\">El periodo es el tiempo que emplea una partícula en realizar una vuelta o\r\ncompletar un ciclo.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Imagen_x0020_336092\" o:spid=\"_x0000_i1053\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" style=\"width:175.5pt;height:51pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image007.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" croptop=\"24347f\" cropbottom=\"35214f\" cropleft=\"18316f\" cropright=\"35625f\">\r\n</v:imagedata></v:shape><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\">La frecuencia es el número de vueltas o ciclos que realiza una partícula en\r\nla unidad de tiempo, por ejemplo, en un segundo.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><v:shape id=\"Imagen_x0020_336093\" o:spid=\"_x0000_i1052\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" style=\"width:201.75pt;height:48pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image007.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" croptop=\"41525f\" cropbottom=\"18335f\" cropleft=\"19829f\" cropright=\"32264f\">\r\n</v:imagedata></v:shape><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><v:shape id=\"Imagen_x0020_336094\" o:spid=\"_x0000_i1051\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" style=\"width:62.25pt;height:44.25pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image007.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" croptop=\"50786f\" cropbottom=\"8625f\" cropleft=\"19408f\" cropright=\"41338f\">\r\n</v:imagedata></v:shape><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:\r\nES\">En función del periodo y la frecuencia, la velocidad angular se expresa del\r\nsiguiente modo. En una vuelta completa el desplazamiento angular </span><span style=\"font-family: Arial, sans-serif; color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">θ</span><span lang=\"ES\" style=\"font-size:12.0pt;line-height:107%;mso-bidi-font-family:Calibri;\r\nmso-bidi-theme-font:m