a velocidad vA, Figura 4.9 en particular en un punto\r\nQ de la periferia de B, cuya velocidad tangencial denotamos por vB, la\r\nvelocidad tangencial es la misma, es decir:<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Imagen_x0020_336116\" o:spid=\"_x0000_s1029\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente\" style=\"position:absolute;margin-left:276.75pt;margin-top:14.8pt;width:171pt;\r\n height:87.15pt;z-index:251663360;visibility:visible;mso-wrap-style:square;\r\n mso-width-percent:0;mso-height-percent:0;mso-wrap-distance-left:9pt;\r\n mso-wrap-distance-top:0;mso-wrap-distance-right:9pt;\r\n mso-wrap-distance-bottom:0;mso-position-horizontal:absolute;\r\n mso-position-horizontal-relative:text;mso-position-vertical:absolute;\r\n mso-position-vertical-relative:text;mso-width-percent:0;mso-height-percent:0;\r\n mso-width-relative:margin;mso-height-relative:margin\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image020.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"22877f\" cropbottom=\"28100f\" cropleft=\"30883f\" cropright=\"18590f\">\r\n <w:wrap type=\"through\">\r\n</w:wrap></v:imagedata></v:shape><v:shape id=\"Imagen_x0020_336113\" o:spid=\"_x0000_i1035\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" style=\"width:106.5pt;height:33.75pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image021.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" croptop=\"14144f\" cropbottom=\"47046f\" cropleft=\"18861f\" cropright=\"38951f\">\r\n</v:imagedata></v:shape><span lang=\"ES\" style=\"font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:ES\">&nbsp; con v = </span><span s