rio gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" croptop=\"25326f\" cropbottom=\"38143f\" cropleft=\"18070f\" cropright=\"43950f\">\r\n</v:imagedata></v:shape>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<v:shape id=\"Imagen_x0020_336119\" o:spid=\"_x0000_i1032\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" style=\"width:50.25pt;height:20.25pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image023.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" croptop=\"32301f\" cropbottom=\"30247f\" cropleft=\"20217f\" cropright=\"41170f\">\r\n</v:imagedata></v:shape><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <v:shape id=\"Imagen_x0020_336120\" o:spid=\"_x0000_i1031\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" style=\"width:240.75pt;height:46.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image023.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" croptop=\"38466f\" cropbottom=\"21468f\" cropleft=\"20587f\" cropright=\"28669f\">\r\n</v:imagedata></v:shape><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\"><b>POLEAS CONECTADAS\r\nCONCÉNTRICAMENTE<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">En\r\nla figura se observa a dos poleas A y B girando en torno a un mismo eje\r\ncomún.&nbsp; Ya que ambas poleas están\r\nconectadas al eje, cada una de ellas completa una vuelta en el mismo tiempo,\r\nentonces sus velocidades angulares son iguales.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Aun\r\ncuando ambas poleas giran con la misma velocidad y aceleración angulares, sus\r\nvelocidades y aceleraciones tangenciales son diferentes; las de B son mayores a\r\nlas de A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Picture_x0020_515972\" o:spid=\"_x0000_s1028\" type=\"#_x0000_t75\" alt=\"Imagen en blanco y negro de un reloj\r\n\r\nDescripción generada automáticamente con confianza media\" style=\"position:absolute;margin-left:197.6pt;margin-top:4.05pt;width:112.7pt;\r\n height:59.75pt;z-index:251666432;visibility:visible;mso-wrap-style:square;\r\n mso-width-percent:0;mso-height-percent:0;mso-wrap-distance-left:9pt;\r\n mso-wrap-distance-top:0;mso-wrap-distance-right:9pt;\r\n mso-wrap-distance-bottom:0;mso-position-horizontal:absolute;\r\n mso-position-horizontal-relative:text;mso-position-vertical:absolute;\r\n mso-position-vertical-relative:text;mso-width-percent:0;mso-height-percent:0;\r\n mso-width-relative:margin;mso-height-relative:margin\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image024.jpg\" o:title=\"Imagen en blanco y negro de un reloj\r\n\r\nDescripción generada automáticamente con confianza media\">\r\n <w:wrap type=\"through\">\r\n</w:wrap></v:imagedata></v:shape><v:shape id=\"Imagen_x0020_336121\" o:spid=\"_x0000_i1030\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:73.5pt;height:21pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image025.png\" o:title=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"28015f\" cropbottom=\"34536f\" cropleft=\"20907f\" cropright=\"38802f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Imagen_x0020_336122\" o:spid=\"_x0000_i1029\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:89.25pt;height:34.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image025.png\" o:title=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"33888f\" cropbottom=\"27073f\" cropleft=\"20743f\" cropright=\"38228f\">\r\n</v:imagedata></v:shape><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\"><b>ENGRANAJES CONECTADOS\r\nTANGENCIALMENTE<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Asumamos\r\nque el engranaje A transmite movimiento al B (vea figura). La velocidad angular\r\nde A es </span><span style=\"font-family: Arial, sans-serif; color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">ω</span><span lang=\"ES\">A , y en el punto de contacto posee una velocidad tangencial VA , como el\r\ncontacto se da diente con diente, la velocidad tangencial del engranaje B, VB ,\r\ndebe ser igual a VA.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Picture_x0020_515974\" o:spid=\"_x0000_s1027\" type=\"#_x0000_t75\" alt=\"Diagrama\r\n\r\nDescripción generada automáticamente\" style=\"position:absolute;margin-left:158.2pt;margin-top:1.9pt;width:163.05pt;\r\n height:79.8pt;z-index:251668480;visibility:visible;mso-wrap-style:square;\r\n mso-wrap-distance-left:9pt;mso-wrap-distance-top:0;mso-wrap-distance-right:9pt;\r\n mso-wrap-distance-bottom:0;mso-position-horizontal:absolute;\r\n mso-position-horizontal-relative:text;mso-position-vertical:absolute;\r\n mso-position-vertical-relative:text\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image026.jpg\" o:title=\"Diagrama\r\n\r\nDescripción generada automáticamente\">\r\n <w:wrap type=\"through\">\r\n</w:wrap></v:imagedata></v:shape><v:shape id=\"Imagen_x0020_336123\" o:spid=\"_x0000_i1028\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:96.75pt;height:36pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image027.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"27359f\" cropbottom=\"33701f\" cropleft=\"21010f\" cropright=\"37757f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Imagen_x0020_336124\" o:spid=\"_x0000_i1027\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:111pt;height:31.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image027.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"34265f\" cropbottom=\"27160f\" cropleft=\"21270f\" cropright=\"36173f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b>ACELERACIÓN CENTRÍPETA<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">La\r\naceleración centrípeta (también llamada aceleración normal) , es la aceleración\r\nque determina el cambio de dirección de la velocidad en los cuerpos que rotan o\r\nse mueven por trayectorias curvas. Esta aceleración recibe el nombre de\r\ncentrípeta porque siempre está dirigida hacia el centro de rotación.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Picture_x0020_516091\" o:spid=\"_x0000_s1026\" type=\"#_x0000_t75\" alt=\"Diagrama\r\n\r\nDescripción generada automáticamente con confianza media\" style=\"position:absolute;margin-left:244.85pt;margin-top:4.65pt;width:80.25pt;\r\n height:74.25pt;z-index:251670528;visibility:visible;mso-wrap-style:square;\r\n mso-width-percent:0;mso-height-percent:0;mso-wrap-distance-left:9pt;\r\n mso-wrap-distance-top:0;mso-wrap-distance-right:9pt;\r\n mso-wrap-distance-bottom:0;mso-position-horizontal:absolute;\r\n mso-position-horizontal-relative:text;mso-position-vertical:absolute;\r\n mso-position-vertical-relative:text;mso-width-percent:0;mso-height-percent:0;\r\n mso-width-relative:margin;mso-height-relative:margin\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image028.jpg\" o:title=\"Diagrama\r\n\r\nDescripción generada automáticamente con confianza media\">\r\n <w:wrap type=\"through\">\r\n</w:wrap></v:imagedata></v:shape><span lang=\"ES\">Su módulo\r\nse determina por la siguiente ecuación: <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_336127\" o:spid=\"_x0000_i1026\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:79.5pt;height:50.25pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image029.png\" o:title=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"25673f\" cropbottom=\"33982f\" cropleft=\"22370f\" cropright=\"37915f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">donde\r\nV, es la velocidad lineal de la partícula que realiza el movimiento de rotación\r\ny R es el radio de curvatura de su trayectoria.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">También\r\nla aceleración centrípeta se puede expresar en función de la velocidad angular\r\nde la partícula, mediante la relación:&nbsp;</span><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_192928\" o:spid=\"_x0000_i1025\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:103.5pt;height:40.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image029.png\" o:title=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"37814f\" cropbottom=\"22032f\" cropleft=\"19226f\" cropright=\"38072f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>', '2021-11-12 18:19:30', '2021-11-12 19:15:14');
INSERT INTO `introduccions` (`id`, `seccion`, `contenido`, `created_at`, `updated_at`) VALUES
(7, 'Dinámica lineal', '<p class=\"MsoListParagraph\" align=\"center\" style=\"text-align:center\"><b><span lang=\"ES\" style=\"font-size:22.0pt;line-height:107%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:ES\">DINAMICA LINEAL<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:ES\">Es parte de la\r\nfísica que estudia que estudia la relación entre el movimiento de los cuerpos y\r\nlas fuerzas que actúan sobre ellos.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:ES\">La dinámica\r\nlineal tiene lugar cuando la fuerza neta rompe el equilibrio y acelera el\r\nobjeto en trayectoria rectilínea. Se sugiere fijar un sistema cartesiano para\r\nel DCL del objeto en el que uno de los ejes sea colineal a la dirección de la\r\naceleración. En este eje debes aplicar la segunda ley (F=ma). Normalmente en el\r\notro eje, se cumple el equilibrio (F=0).<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shapetype id=\"_x0000_t75\" coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\" path=\"m@4@5l@4@11@9@11@9@5xe\" filled=\"f\" stroked=\"f\">\r\n <v:stroke joinstyle=\"miter\">\r\n <v:formulas>\r\n  <v:f eqn=\"if lineDrawn pixelLineWidth 0\">\r\n  <v:f eqn=\"sum @0 1 0\">\r\n  <v:f eqn=\"sum 0 0 @1\">\r\n  <v:f eqn=\"prod @2 1 2\">\r\n  <v:f eqn=\"prod @3 21600 pixelWidth\">\r\n  <v:f eqn=\"prod @3 21600 pixelHeight\">\r\n  <v:f eqn=\"sum @0 0 1\">\r\n  <v:f eqn=\"prod @6 1 2\">\r\n  <v:f eqn=\"prod @7 21600 pixelWidth\">\r\n  <v:f eqn=\"sum @8 21600 0\">\r\n  <v:f eqn=\"prod @7 21600 pixelHeight\">\r\n  <v:f eqn=\"sum @10 21600 0\">\r\n </v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:formulas>\r\n <v:path o:extrusionok=\"f\" gradientshapeok=\"t\" o:connecttype=\"rect\">\r\n <o:lock v:ext=\"edit\" aspectratio=\"t\">\r\n</o:lock></v:path></v:stroke></v:shapetype><v:shape id=\"Imagen_x0020_306678\" o:spid=\"_x0000_i1035\" type=\"#_x0000_t75\" alt=\"Dibujo de una persona\r\n\r\nDescripción generada automáticamente con confianza media\" style=\"width:174.75pt;height:119.25pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image001.jpg\" o:title=\"Dibujo de una persona\r\n\r\nDescripción generada automáticamente con confianza media\">\r\n</v:imagedata></v:shape><span lang=\"ES\" style=\"font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:ES\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\"><b><span lang=\"ES\" style=\"font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:ES\">SEGUNDA LEY DE\r\nNEWTON<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:ES\">Supondremos en\r\nprincipio que la interacción sobre un objeto es constante, es decir la fuerza\r\nque interactúa es constante en valor. De acuerdo con el principio de la\r\ninercia, si sobre un obJàõñE— obra fuerza a guna, éste debe permanecer en\r\nreposo o moviéndose con velocidad constante. Esto supone que si existe la\r\nacción de alguna fuerza, este objeto debe cambiar su velocidad durante todo el\r\ntiempo que actúa la decir, la aceleración a que a usarcé un bloque de masa m es\r\ndirectamente proporcional a la fuerza F aplicada, enuncia o que corresponde a\r\nla segunda ley de Newton.</span><span lang=\"ES\"> <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Imagen_x0020_192941\" o:spid=\"_x0000_i1034\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:1in;height:30pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image002.png\" o:title=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"17644f\" cropbottom=\"43597f\" cropleft=\"18326f\" cropright=\"41379f\">\r\n</v:imagedata></v:shape>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <v:shape id=\"Imagen_x0020_192942\" o:spid=\"_x0000_i1033\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:63pt;height:36pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image002.png\" o:title=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"26420f\" cropbottom=\"32394f\" cropleft=\"18800f\" cropright=\"40066f\">\r\n</v:imagedata></v:shape><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Imagen_x0020_192943\" o:spid=\"_x0000_i1032\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:50.25pt;height:37.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image002.png\" o:title=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"38369f\" cropbottom=\"20443f\" cropleft=\"18957f\" cropright=\"41484f\">\r\n</v:imagedata></v:shape><span lang=\"ES\" style=\"font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:ES\">&nbsp; </span><span lang=\"ES\">&nbsp;&nbsp;&nbsp;&nbsp;</span><v:shape id=\"Imagen_x0020_192944\" o:spid=\"_x0000_i1031\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:50.25pt;height:22.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image003.png\" o:title=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"43597f\" cropbottom=\"17737f\" cropleft=\".375\" cropright=\"35602f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b>NATURALEZA VECTORIAL DE LA LEY DE NEWTON<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Cuando\r\nun hombre empuja un automóvil que se halla en reposo, el automóvil se mueve en\r\nla misma dirección y sentido del empuje, como se observa en las figuras<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_192945\" o:spid=\"_x0000_i1030\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente con confianza media\" style=\"width:263.25pt;height:124.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image004.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente con confianza media\" croptop=\"28194f\" cropbottom=\"13628f\" cropleft=\"16961f\" cropright=\"20373f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">De\r\nacuerdo en que dirección y sentido se empuje este automóvil, se moverá en uno u\r\notro&nbsp; sentido. De este ejemplo, se\r\nconcluye que la fuerza es un vector y posee la misma dirección y sentido el\r\ncambio de velocidad o aceleracion, entonces la segunda ley de Newton debe\r\nescribirse rigurosamente como una ecuación vectorial.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Picture_x0020_306667\" o:spid=\"_x0000_s1026\" type=\"#_x0000_t75\" alt=\"Diagrama\r\n\r\nDescripción generada automáticamente\" style=\"position:absolute;left:0;text-align:left;margin-left:218.6pt;\r\n margin-top:40.55pt;width:100.8pt;height:68pt;z-index:251676672;visibility:visible;\r\n mso-wrap-style:square;mso-wrap-distance-left:9pt;mso-wrap-distance-top:0;\r\n mso-wrap-distance-right:9pt;mso-wrap-distance-bottom:0;\r\n mso-position-horizontal:absolute;mso-position-horizontal-relative:text;\r\n mso-position-vertical:absolute;mso-position-vertical-relative:text\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image005.jpg\" o:title=\"Diagrama\r\n\r\nDescripción generada automáticamente\">\r\n <w:wrap type=\"through\">\r\n</w:wrap></v:imagedata></v:shape><v:shape id=\"Imagen_x0020_192947\" o:spid=\"_x0000_i1029\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:54.75pt;height:31.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image006.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"17457f\" cropbottom=\"43406f\" cropleft=\"24734f\" cropright=\"36282f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Imagen_x0020_192948\" o:spid=\"_x0000_i1028\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:120.75pt;height:60.75pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image006.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"23992f\" cropbottom=\"31273f\" cropleft=\"20323f\" cropright=\"33764f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b>TERCERA LEY DE NEWTON<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Las\r\nfuerzas que actúan sobre un cuerpo proceden necesariamente de otro objeto que\r\nconstituye su medio ambiente. es la acción mutua enfre dos objetos, de manera\r\nque s un eportista, por un balón, este recibe una fuerza por parte del\r\nmuchacho, pero la interacción es recíproca, entonces el balón ejerce una fuerza\r\nsobre el pié del deportista, retardando su movimiento; además, estas dos\r\nfuerzas son de igual magnitud y dirección pero de sentido contrario, este\r\nefecto se ilustra en la figura<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span lang=\"ES\">Fuerza de atraccion y reaccion<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_192949\" o:spid=\"_x0000_i1027\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Word\r\n\r\nDescripción generada automáticamente\" style=\"width:164.25pt;height:135.75pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image007.png\" o:title=\"Interfaz de usuario gráfica, Texto, Word\r\n\r\nDescripción generada automáticamente\" croptop=\"13913f\" cropbottom=\"27166f\" cropleft=\"34716f\" cropright=\"16910f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Imagen_x0020_192950\" o:spid=\"_x0000_i1026\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" style=\"width:111pt;height:93pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image008.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" croptop=\"21009f\" cropbottom=\"27167f\" cropleft=\"36135f\" cropright=\"17802f\">\r\n</v:imagedata></v:shape><span lang=\"ES\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><v:shape id=\"Imagen_x0020_192951\" o:spid=\"_x0000_i1025\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" style=\"width:99pt;height:24.75pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image008.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" croptop=\"36502f\" cropbottom=\"26139f\" cropleft=\"22633f\" cropright=\"36443f\">\r\n</v:imagedata></v:shape><o:p></o:p></p>', '2021-11-12 18:19:30', '2021-11-12 19:15:25'),
(8, 'Trabajo y energía', '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><b><span style=\"font-size:22.0pt;line-height:107%\">TRABAJO Y ENERGIA<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Trabajo y energía\r\nrelacionados: energía es capacidad para realizar trabajo (cuando un sistema\r\nrealiza un trabajo sobre otro le transfiere energía)<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Las leyes de\r\nconservación de la energía y de la cantidad de movimiento son leyes generales\r\nde la naturaleza que trascienden la fisica, así son aplicables también a otros\r\ncampos fenomenológicos como la química, por ello su importancia y se convierten\r\nen la piedra angular de la fisica, cuyo valor es dificil de cuantificarse.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">La gran\r\nimportancia de las leyes de la conservación de la energía radica en el hecho de\r\nque éstas no dependen de la trayectoria de las partículas ni del carácter de\r\nlas fuerzas que actúan, debido a ello pueden emplearse en procesos mecánicos en\r\nlos cuales las fuerzas involucradas son desconocidas, convirtiéndose estas\r\nleyes en instrumentos insustituibles. Por otro lado, si determinado proceso\r\nviola las leyes de la conservación de la energía o cantidad de movimiento, se\r\npuede asegurar que dicho proceso es imposible. Finalmente, en aquellos procesos\r\nen los cuales se conocen las leyes de las fuerzas que actúan, las leyes de la\r\nconservación pueden permitir la solución simple de los problemas.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b>TRABAJO DE UNA\r\nFUERZA CONSTANTE<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">En el caso más\r\nsencillo, consideremos una partícula moviéndose en línea recta, sobre la cual\r\nobra una fuerza constante, como se observa en la figura<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shapetype id=\"_x0000_t75\" coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\" path=\"m@4@5l@4@11@9@11@9@5xe\" filled=\"f\" stroked=\"f\">\r\n <v:stroke joinstyle=\"miter\">\r\n <v:formulas>\r\n  <v:f eqn=\"if lineDrawn pixelLineWidth 0\">\r\n  <v:f eqn=\"sum @0 1 0\">\r\n  <v:f eqn=\"sum 0 0 @1\">\r\n  <v:f eqn=\"prod @2 1 2\">\r\n  <v:f eqn=\"prod @3 21600 pixelWidth\">\r\n  <v:f eqn=\"prod @3 21600 pixelHeight\">\r\n  <v:f eqn=\"sum @0 0 1\">\r\n  <v:f eqn=\"prod @6 1 2\">\r\n  <v:f eqn=\"prod @7 21600 pixelWidth\">\r\n  <v:f eqn=\"sum @8 21600 0\">\r\n  <v:f eqn=\"prod @7 21600 pixelHeight\">\r\n  <v:f eqn=\"sum @10 21600 0\">\r\n </v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:f></v:formulas>\r\n <v:path o:extrusionok=\"f\" gradientshapeok=\"t\" o:connecttype=\"rect\">\r\n <o:lock v:ext=\"edit\" aspectratio=\"t\">\r\n</o:lock></v:path></v:stroke></v:shapetype><v:shape id=\"Imagen_x0020_192952\" o:spid=\"_x0000_i1040\" type=\"#_x0000_t75\" alt=\"Diagrama\r\n\r\nDescripción generada automáticamente\" style=\"width:279pt;\r\n height:122.25pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image001.png\" o:title=\"Diagrama\r\n\r\nDescripción generada automáticamente\" croptop=\"19604f\" cropbottom=\"22120f\" cropleft=\"16804f\" cropright=\"18064f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Se dice que una\r\nfuerza, F, realiza un trabajo, W, cuando aplicada sobre un cuerpo de masa, m,\r\nlogra un desplazamiento, d. Matemáticamente, el trabajo (PD se define como el\r\nproducto escalar.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Imagen_x0020_192953\" o:spid=\"_x0000_i1039\" type=\"#_x0000_t75\" alt=\"Diagrama\r\n\r\nDescripción generada automáticamente\" style=\"width:73.5pt;height:20.25pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image002.png\" o:title=\"Diagrama\r\n\r\nDescripción generada automáticamente\" croptop=\"43878f\" cropbottom=\"18204f\" cropleft=\"24051f\" cropright=\"34553f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b>TRABAJO DE UNA\r\nFUERZA VARIABLE<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">La fuerza que\r\nactúa sobre una partícula no es necesariamente constante, como es el caso de la\r\nfuerza elástica de un resorte. Un experimento sencillo, que nos permite\r\nvisualizar la fuerza que ejerce un resorte, será aquella en la cual colgamos<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">un resorte en\r\nforma vertical, como se muestra en la figura 6.3(a). Por simplicidad,\r\ndespreciaremos la masa del resorte; el extremo inferior del resorte será el\r\ncero de nuestra escala de distancia. Luego colgamos del extremo inferior un\r\nobjeto de masa M, la distancia que se estira el resorte es x, y la aplicación\r\nde la segunda ley de Newton señala:<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Imagen_x0020_192956\" o:spid=\"_x0000_s1028\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente con confianza media\" style=\"position:absolute;margin-left:236.2pt;margin-top:0;width:120.75pt;\r\n height:102.2pt;z-index:251679744;visibility:visible;mso-wrap-style:square;\r\n mso-width-percent:0;mso-height-percent:0;mso-wrap-distance-left:9pt;\r\n mso-wrap-distance-top:0;mso-wrap-distance-right:9pt;\r\n mso-wrap-distance-bottom:0;mso-position-horizontal:absolute;\r\n mso-position-horizontal-relative:text;mso-position-vertical:absolute;\r\n mso-position-vertical-relative:text;mso-width-percent:0;mso-height-percent:0;\r\n mso-width-relative:margin;mso-height-relative:margin\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image003.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente con confianza media\" croptop=\"18394f\" cropbottom=\"26606f\" cropleft=\"34821f\" cropright=\"17067f\">\r\n <w:wrap type=\"through\">\r\n</w:wrap></v:imagedata></v:shape><v:shape id=\"Imagen_x0020_192954\" o:spid=\"_x0000_i1038\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente con confianza media\" style=\"width:103.5pt;height:33.75pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image004.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente con confianza media\" croptop=\"40143f\" cropbottom=\"20165f\" cropleft=\"17959f\" cropright=\"38544f\">\r\n</v:imagedata></v:shape><span lang=\"ES\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><v:shape id=\"Imagen_x0020_192955\" o:spid=\"_x0000_i1037\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente con confianza media\" style=\"width:1in;height:29.25pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image004.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente con confianza media\" croptop=\"48645f\" cropbottom=\"12603f\" cropleft=\"18382f\" cropright=\"41117f\">\r\n</v:imagedata></v:shape><span lang=\"ES\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\"><b>&nbsp;</b></p>\r\n\r\n<p class=\"MsoNormal\"><b>TRABAJO\r\nEFECTUADO POR VARIAS FUERZAS<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Hasta ahora se\r\nhan estudiado casos en los procesos en movimiento en los cuales actúa una sola\r\nfuerza. Sin embargo, en dichos procesos pueden hallarse presentes varias\r\nfuerzas.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Si sobre un\r\nobjeto obran varias fuerzas, la resultante de éstas será:<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Imagen_x0020_192957\" o:spid=\"_x0000_i1036\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente con confianza media\" style=\"width:2in;height:29.25pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image005.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente con confianza media\" croptop=\"24091f\" cropbottom=\"37063f\" cropleft=\"19224f\" cropright=\"34133f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Imagen_x0020_192958\" o:spid=\"_x0000_i1035\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente con confianza media\" style=\"width:150pt;height:21.75pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image005.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente con confianza media\" croptop=\"37628f\" cropbottom=\"24552f\" cropleft=\"19222f\" cropright=\"33398f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Imagen_x0020_306659\" o:spid=\"_x0000_i1034\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente con confianza media\" style=\"width:170.25pt;height:30.75pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image006.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente con confianza media\" croptop=\"33986f\" cropbottom=\"26233f\" cropleft=\"19380f\" cropright=\"29670f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Imagen_x0020_306660\" o:spid=\"_x0000_i1033\" type=\"#_x0000_t75\" alt=\"Texto\r\n\r\nDescripción generada automáticamente con confianza media\" style=\"width:155.25pt;height:32.25pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image006.png\" o:title=\"Texto\r\n\r\nDescripción generada automáticamente con confianza media\" croptop=\"42388f\" cropbottom=\"17924f\" cropleft=\"21533f\" cropright=\"29985f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b>POTENCIA<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Con frecuencia no\r\nsólo importa la cantidad de trabajo efectuado, sino también la rapidez con que\r\nse realiza trabajo, en especial en aplicaciones de ingeniería.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">La potencia, P,\r\ndesarrollada por un equipo, se define como el trabajo realizado en la unidad de\r\ntiempo, entonces:<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_306661\" o:spid=\"_x0000_i1032\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:75pt;height:32.25pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image007.png\" o:title=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"16524f\" cropbottom=\"43410f\" cropleft=\"29040f\" cropright=\"29249f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><v:shape id=\"Imagen_x0020_306662\" o:spid=\"_x0000_i1031\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" style=\"width:67.5pt;height:121.5pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image007.png\" o:title=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"26887f\" cropbottom=\"16057f\" cropleft=\"25206f\" cropright=\"33293f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b>ENERGÍA<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">En cualquier\r\nproceso que se lleve a cabo en nuestra vida cotidiana, ya sea físico, químico o\r\nfisiológico, está siempre presente el tema de la energía, por ejemplo, en la\r\niluminación nocturna de nuestros hogares consumimos energía eléctrica, el motor\r\nde un automóvil desarrolla energía mecánica gracias a la reacción química del\r\ncombustible, la energía solar da vida a las plantas, nosotros mismos nos\r\nmovemos gracias a la energía que nos proporciona los alimentos que ingerimos,\r\netc.. De esta manera, reconocemos a la energía como una de las magnitudes\r\nfísicas más importantes de la naturaleza.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b>ENERGÍA\r\nPOTENCIAL GRAVITACIONAL (Ep)<o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\">Nuestro objetivo,\r\nplanteado en la introducción de este capítulo, es determinar variables de\r\nestado, vale decir, variables que indican el estado de un sistema que no\r\ncambien en el tiempo y nos permitan simplificar el análisis de los fenómenos\r\nmecánicos. En este sentido, estas variables de estado deben estar relacionadas\r\nnecesariamente con fuerzas conservativas.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Imagen_x0020_306664\" o:spid=\"_x0000_i1030\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" style=\"width:112.5pt;height:18.75pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image008.png\" o:title=\"Interfaz de usuario gráfica, Texto, Aplicación, Word\r\n\r\nDescripción generada automáticamente\" croptop=\"45749f\" cropbottom=\"15870f\" cropleft=\"20482f\" cropright=\"31665f\">\r\n</v:imagedata></v:shape><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"ES\" style=\"font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:ES\">La altura h,\r\ncorresponde a la diferencia, y 2 — y 1</span><span lang=\"ES\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><v:shape id=\"Imagen_x0020_306668\" o:spid=\"_x0000_s1027\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" style=\"position:absolute;margin-left:261.7pt;margin-top:14.35pt;width:62.25pt;\r\n height:80pt;z-index:251681792;visibility:visible;mso-wrap-style:square;\r\n mso-width-percent:0;mso-height-percent:0;mso-wrap-distance-left:9pt;\r\n mso-wrap-distance-top:0;mso-wrap-distance-right:9pt;\r\n mso-wrap-distance-bottom:0;mso-position-horizontal:absolute;\r\n mso-position-horizontal-relative:text;mso-position-vertical:absolute;\r\n mso-position-vertical-relative:text;mso-width-percent:0;mso-height-percent:0;\r\n mso-width-relative:margin;mso-height-relative:margin\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtmlclip1/01/clip_image009.png\" o:title=\"Interfaz de usuario gráfica, Texto\r\n\r\nDescripción generada automáticamente\" croptop=\"11578f\" cropbottom=\"38834f\" cropleft=\"42325f\" cropright=\"16594f\">\r\n <w:wrap type=\"through\">\r\n</w:wrap></v:imagedata></v:shape>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <v:shape id=\"Imagen_x0020_306663\" o:spid=\"_x0000_i1029\" type=\"#_x0000_t75\" alt=\"Interfaz de usuario gráfica, Texto, Aplicación\r\n\r\nDescripción generada automáticamente\" style=\"width:78pt;height:21.75pt;visibility:visible;mso-wrap-style:square\">\r\n <v:imagedata src=\"file:///C:/Users/victo/AppData/Local/Temp/msohtml